import React, { useState } from 'react';
import { Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer';
import styles from "assets/jss/material-kit-react/views/componentsSections/tabsStyle.js";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles(styles);

export default function ExperienceSection() {
  const classes = useStyles();
  const [numPages, setNumPages] = useState(null);
  const [pageNumber, setPageNumber] = useState(1);
  const styles = StyleSheet.create({
    page: {
      flexDirection: 'row',
      backgroundColor: '#E4E4E4'
    },
    section: {
      margin: 10,
      padding: 10,
      flexGrow: 1
    }
  });

  function onDocumentLoadSuccess({ numPages }) {
    setNumPages(numPages);
  }

  return (
    <div style={{backgroundColor:"white"}} className={classes.section}>
      <div  className={classes.container}>
        <div  id="navigation-pills">
          <div className={classes.title}>
            <h1 >Experience</h1>
            <hr  style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
          </div>
          <div >
          <h2 style={{paddingTop:"50px"}}>Check out my Linkedin:</h2>
          <div class="LI-profile-badge"  data-version="v1" data-size="large" data-locale="en_US" data-type="vertical" data-theme="dark" data-vanity="tanishqsandhu"><a class="LI-simple-link" href='https://www.linkedin.com/in/tanishqsandhu?trk=profile-badge'>Tanishq Sandhu</a></div>          </div>
        </div>
        <div>
        <Document
        file={require("../../../assets/Resume.pdf")}
        onLoadSuccess={onDocumentLoadSuccess}
      >
        <Page pageNumber={pageNumber} />
      </Document>
      <p>Page {pageNumber} of {numPages}</p>
        </div>
      </div>
    </div>
  );
}
